function parseArray($response)
{
    $response = str_replace(',2017', '2017', $response);
    $response = explode('2017', $response);
    $crid = [];
    foreach ($response as $value) {
        $crid[] = ['crid' => delimiterString($value), 'length' => strlen(delimiterString($value))];
    }

    for ($i = 0; $i <= count($crid); $i++) {
        if ($crid[$i]['length'] == '0') {
            unset($crid[$i]);
        }
    }

    echo '<pre>';
    print_r($crid);
    echo '</pre>';

}

function delimiterString($string)
{
    return getInnerString($string, '[replaced]:', '"');
}


function getInnerString($stringToExtract, $startString, $endString)
{
    return getStringBetweenDelimiters($stringToExtract, $startString, $endString, false);
}

function getStringBetweenDelimiters($stringToExtract, $startString, $endString = '', $verbose = true)
{
    $ini = stripos($stringToExtract, $startString);

    if ($ini === false) {
        return false;
    }

    $ini += strlen($startString);
    if ($endString == '') {
        $endPos = $len = strlen($stringToExtract);
    } else {

        $endPos = stripos($stringToExtract, $endString, $ini);
        if ($endPos === false) {
            return false;
        }

        $len = $endPos - $ini;
    }

    if ($verbose) {
        return [
            'start' => substr($stringToExtract, 0, $ini),
            'find' => substr($stringToExtract, $ini, $len),
            'end' => substr($stringToExtract, $endPos),
        ];
    } else {
        return substr($stringToExtract, $ini, $len);
    }
}

